import React from "react";
import logo from "./images/logo.svg";
import { FaBars } from "react-icons/fa";

const Navbar = () => {
	return (
		<nav className="nav">
			<div className="nav-center">
				<div className="nav-header">
					<img src={logo} alt="logo" className="nav-logo" />
				</div>
				ul.nav-links
			</div>
		</nav>
	);
};

export default Navbar;
